import React from "react";
import ColorPicker from "../../../components/ColorPicker";
import DraggableChangeColorWrapper from "../../../assets/wrappers/BannerCreator/DraggableChangeColorWrapper";
import { AiOutlineBgColors } from "react-icons/ai";

const DraggableChangeColor = ({ color, onChangeColorPicker }) => {
  return (
    <DraggableChangeColorWrapper style={{ marginLeft: "1rem" }}>
      <ColorPicker color={color} onChangeColorPicker={onChangeColorPicker}>
        <AiOutlineBgColors />
      </ColorPicker>
    </DraggableChangeColorWrapper>
  );
};

export default DraggableChangeColor;
